import { Container, Text, Image } from "@chakra-ui/react";

function Profile(){
    return(
        <div>
            <Box>
                <Image src="https://preview.redd.it/7ayjc8s4j2n61.png?auto=webp&s=609a58fa21d46424879ee44156e44e0404940583" alt='default pic'/>
            </Box>
            <Container>
                <Text>Hello there</Text>
            </Container>
        </div>
    )}

export default Profile;
